const Submit = (props) =>{

    console.log(this.props.location.state);

    return(
        <div className='h-screen w-screen bg-white'>
            <NavBar displayButton = {false} clickableLogo = {true}/>
            <InfoSubmit />
            <Footer />
        </div>
    )
}

export default Submit;
